import React from "react";
import './style.css'


function About() {
  return (
    <div>
       <div className='jumbotron aboutpg'>
        <h1>Who am I?</h1>
        <p>
        My name is Lois Aleghe and I am 20 years. I am a fourth year
            Software Engineering Student at Carleton University. My hobbies
            include writing, listening to music, hanging out with friends and
            sometimes cooking. <br /><br />
            I love coding in my free time and I do hope one day I would be able
            to create something that the world would benefit from, in other
            words, I hope to make a difference in the world through technology.
            Feel free to contact me and let us create something beautiful
            together :)
        </p>
      </div>
    </div>
  );
}

export default About;
